import React from 'react';
import { useContext } from 'react';
import { userData } from '../App';
import Event from './animatedEvent';
import Friendevent from './Friendevent';
import axios from 'axios';
export default function Archive() {
   const user = useContext(userData);
   return (
      <div className="float mt-5">
         {user && user.events &&
            user.events.map(i => i.date > new Date() ? i : null)
               .map((item, index) =>
                  item.id == user.data.id ? (
                     <Event
                        index={index}
                        title={item.title}
                        date={item.date}
                        duration={item.duration}
                        onDelete={() => leaveEvent(item.relation)}
                        //onFocus={() => Focus(!focused && index + 1)}
                        //use index+1 becasue false&&0 returns 0, they are both falsey
                     />
                  ) : (
                     <Friendevent
                        index={index}
                        title={item.title}
                        date={item.date}
                        duration={item.duration}
                        owner={item.username}
                        onLeave={() => leaveEvent(item.relation)}
                        //onFocus={() => Focus(index)}
                     />
                  )
               )}
      </div>
   );
}
async function leaveEvent(realtionship) {
   // console.log(realtionship, 'relationshp');
   const cookie = localStorage.getItem('token');
   return await axios.post(
      `http://localhost:8000/leaveevent/${realtionship}`,
      {},
      { headers: { Authorization: 'Bearer ' + cookie } }
   );
}
